import "./App.css";
import Navbar from "./Components/Navbar";
import Main from "./Pages/Main";
import Portfolio from "./Pages/Portfolio";
import Resume from "./Pages/Resume";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Main />
      <Portfolio />
      <Resume />
    </div>
  );
}

export default App;
